// client/src/App.js
import React from "react";
import { BrowserRouter as Router, Routes, Route, Link, Navigate } from "react-router-dom";
import Login from "./Components/Login";
import Register from "./Components/Register";
import Profile from "./Components/Profile";
import Home from "./Components/Home";
import SavingsForm from "./Components/SavingsForm";
import Feedback from "./Components/Feedback"; 
import TopSavers from "./Components/TopSavers"; // ✅ Import TopSavers
import SavingsChart from "./Components/SavingsChart"; // ✅ Import SavingsChart
import { Container, Row, Col } from "reactstrap";
import { useSelector, useDispatch } from "react-redux";
import { logout } from "./Features/UserSlice";
import './App.css'; 

const App = () => {
  const email = useSelector((state) => state.users.user.email);
  const dispatch = useDispatch();

  const PrivateRoute = ({ children }) => {
    return email ? children : <Navigate to="/login" />;
  };

  return (
    <Router>
      <div className="page">
        {/* 🔝 Top Header */}
        <Row className="header align-items-center">
          <Col>
            {email && <div>Welcome, {email}</div>}
          </Col>
          <Col className="text-end">
            {email && (
              <div>
                <Link to="/home" style={{ color: "white", marginRight: "15px" }}>Home</Link>
                <Link to="/profile" style={{ color: "white", marginRight: "15px" }}>Profile</Link>
                <Link to="/savings" style={{ color: "white", marginRight: "15px" }}>Savings</Link>
                <Link to="/feedback" style={{ color: "white", marginRight: "15px" }}>Feedback</Link>
                <Link to="/top-savers" style={{ color: "white", marginRight: "15px" }}>Top Savers</Link>
                <Link to="/savings-chart" style={{ color: "white", marginRight: "15px" }}>Savings Chart</Link>
                <Link
                  to="/login"
                  style={{ color: "white", textDecoration: "underline", cursor: "pointer" }}
                  onClick={() => dispatch(logout())}
                >
                  Logout
                </Link>
              </div>
            )}
          </Col>
        </Row>

        {/* 🔄 Main Routes */}
        <main className="main">
          <Routes>
            <Route path="/" element={<Login />} />
            <Route path="/login" element={<Login />} />
            <Route path="/register" element={<Register />} />
            <Route path="/home" element={<PrivateRoute><Home /></PrivateRoute>} />
            <Route path="/profile" element={<PrivateRoute><Profile /></PrivateRoute>} />
            <Route path="/savings" element={<PrivateRoute><SavingsForm /></PrivateRoute>} />
            <Route path="/feedback" element={<PrivateRoute><Feedback /></PrivateRoute>} />
            <Route path="/top-savers" element={<PrivateRoute><TopSavers /></PrivateRoute>} />
            <Route path="/savings-chart" element={<PrivateRoute><SavingsChart /></PrivateRoute>} /> {/* ✅ Corrected */}
          </Routes>
        </main>

        {/* 🔻 Footer */}
        <Row>
          <footer className="footer">
            SaveWell App &copy; {new Date().getFullYear()}
          </footer>
        </Row>
      </div>
    </Router>
  );
};

export default App;
